import Container from "styles/Container";

export default function App() {
  return (
    <div className="App">
      <Container>
        <div className="container mx-auto">
          <h1>Hello CodeSandbox</h1>
          <h2>Start editing to see some magic happen!</h2>
        </div>
      </Container>
    </div>
  );
}
